# @lc code=start
class Solution:
    def updateMatrix(self, mat: List[List[int]]) -> List[List[int]]:

        m, n = len(mat), len(mat[0])
        ans = [[0] * n for _ in range(m)]

        def bfs(row: int, col: int):
            visited = [[False] * n for _ in range(m)] 
            que = [[row, col]]
            level = 0
            while que:
                size = len(que)
                print('queue size: ', size)
                for _ in range(size):
                    r, c = que.pop(0)
                    print(r, c)
                    visited[r][c] = True
                    if mat[r][c] != 0:
                        ans[r][c] = level if ans[r][c] == 0 else min(ans[r][c], level)
                    for dr, dc in [[-1, 0], [1, 0], [0, -1], [0, 1]]:
                        rr, cc = r + dr, c + dc
                        if 0 <= rr < m and 0 <= cc < n and (rr, cc) and not visited[rr][cc] and mat[rr][cc] != 0:
                            que.append([rr, cc])
                level += 1
            print('end')
        
        for r in range(m):
            for c in range(n):
                if mat[r][c] == 0:
                    bfs(r, c)
        return ans

